    }

    &-icon span,
    &-icon span::before,
    &-icon span::after {
      position: absolute;

      content: "";
      display: block;
      width: 3rem;
      height: 0.3rem;
      margin-top: 1.2rem;

      background: $c-chocolate;
      border-radius: 0.3rem;
    }

    &-icon span::before {
      margin-top: -0.8rem;
    }

    &-icon span::after {
      margin-top: 0.8rem;
    }

    &-toggle {
      position: absolute;
      z-index: 3;
      top: 1.1rem;
      right: 1.1rem;

      display: block;
      width: 4rem;
      height: 4rem;

      opacity: 0;
      outline: 1px solid black;

      cursor: pointer;
      pointer-events: all;
    }

    &-content {
      position: absolute;
      z-index: 4;
      top: 0;
      right: 0;

